import React from 'react';
import { Link } from 'react-router-dom';

function MainContent() {
  const videoID = '923127843'; // Example video ID
  const vimeoUrl = `https://player.vimeo.com/video/${videoID}?autoplay=1&loop=1&muted=1&controls=0&background=1`;

  return (
    <div className="container-fluid p-0"> {/* Remove padding to ensure full width */}
      <div className="row">
        <div className="col px-0"> {/* Remove horizontal padding to ensure full width */}
<div style={{ overflow: 'hidden', paddingTop: '56.25%', position: 'relative', backgroundColor: 'transparent', border: 'none' }}>
            <iframe
              src={vimeoUrl}
              style={{
                position: 'absolute',
                top: 0,
                left: 0,
                width: '100%',
                height: '100%',
              }}
              frameBorder="0"
              allow="autoplay; fullscreen; picture-in-picture"
              allowFullScreen
              title="Vimeo Video"
            ></iframe>
          </div>
        </div>
      </div>
      <div className="text-center mt-4"> {/* Use Bootstrap classes for alignment and spacing */}
        <h1>Main Content Area</h1>
        <Link to="/about" className="text-decoration-underline text-primary">Go to About Page</Link>
      </div>
    </div>
  );
}

export default MainContent;
